testName: getAnyList
anyList:
  - value: ANY ('{150,160}'::integer[])
    ansver:
      - "150"
      - "160"
  - value: ANY ('{150,160,2091}'::integer[])
    ansver:
      - "150"
      - "160"
      - "2091"
  - value: ANY ('{'TEST','tEST 1',  'tEST 3'}'::TEXT[])
    ansver:
      - "'TEST'"
      - "'tEST 1'"
      - "'tEST 3'"

